Delete:
always @(posedge clk) begin
  if (cgs_enable_d) begin
    phy_data <= {DATA_PATH_WIDTH{8'hbc}};
  end else begin
    if(tx_ready_d) begin
      phy_data <= data_replaced;
      phy_data <= ilas_data_d;
end

Add:
always @(posedge clk) begin
  if (cgs_enable_d) begin
    phy_data <= {DATA_PATH_WIDTH{8'hbc}};
    if(tx_ready_d) begin
      phy_data <= data_replaced;
    end else begin
      phy_data <= ilas_data_d;
    end
